import './Login.css';
import React, { useState } from 'react';
import { database } from "../../firebase-config";
import {
  createUserWithEmailAndPassword,
  signInWithEmailAndPassword,
} from "firebase/auth";
import { useNavigate } from "react-router-dom";


function Login() {
  
  return (
    <>
    <div className="loginFormDone">
      <div className="box">
        <form className="FormForLogin" autoComplete="off">
          <h2>Sign in</h2>
          <div className="inputBox">
            <input type="text" required="required" onChange={(event) => { setLoginEmail(event.target.value) }} />
            <span>Email</span>
            <i></i>
          </div>
          <div className="inputBox">
            <input type="password" required="required" onChange={(event) => { setLoginPassword(event.target.value) }} />
            <span>Password</span>
            <i></i>
          </div>
          {/* <div class="links">
          <a href="#">Forgot Password ?</a>
          <a href="#">Signup</a>
        </div> */}
          <input type="submit" onClick={login} value="Login" className='submitForm' />
        </form>
      </div>
      </div>
    </>
  )
}

export default Login;
